Ajax, whose mother was Eriboea (569). —τὸν εἰσαεὶ .. χρόνον : the phrase τὸν ἀεὶ χρόνον is frequent. The separation of τὸν εἰσαεὶ from χρόνον deserves notice, as suggesting the possibility hat τὸν ἀεἰ may sometimes have been used (without χρό- νον) as = 'for ever ʼ: a usage which, how- ever, lacks proof: see on El. 1075.— λεηλατήσει: he had gone to the uplands of Mysia (720), 'in pursuit of foesʼ (564) to be despoiled. Cp. Thuc. I. II § 1 (the Greeks at Troy) φαίνονται...πρὸς γεωργίαν τῆς Χερσονήσου τραπόμενοι καὶ λῃστείαν τῆς τροφῆς ἀπορίᾳ. The Iliad glances at such predatory expeditions (e.g. I. 366; 9. 328).—Note the light touch with which the poet accounts for the absence of Teucer—a necessity of the plot, since Teucer might have averted his brotherʼs suicide. 344 . ἀνοίγετε: a usual form of summons, addressed to no particular per- son, but to the inmates of the house generally; Aesch. Ch. 877 ἀλλʼ καὶ λευρόν μήτρον ἀνοίγετε, ἀλλ’ dvolare: 5 Adelph. 4. 4. 26 aperite, aliquis. Ajax πρόσπολοι, though they were not at this time in the house (539).—We should not explain the plur. as addressed by the choregus to the choreutae and Tecmessa. al8a. MdBo: cp. Ph. 1078 φρόνησιν .. λάβοι; Tr. 669 f. προθυμίαν | .. \aBetv.—

Translated by David M. Halperin.

